import React from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { exampleMsg, exampleObj } from "../actions/example";

const ExampleRedux = ({ expMsg, expObj, exampleMessage, exampleObject }) => {
  return (
    <div>
      <button onClick={(e) => exampleMessage()}>Example Message</button>
      <p>{expMsg && expMsg}</p>
      <button onClick={(e) => exampleObject()}>Example Object</button>
      <p>{expObj && expObj}</p>
    </div>
  );
};

ExampleRedux.propTypes = {
  exampleMsg: PropTypes.func.isRequired,
  exampleObj: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  expMsg: state.expMsg,
  expObj: state.expObj,
});

export default connect(mapStateToProps, { exampleMessage, exampleObject })(
  ExampleRedux
);
